import * as React from 'react';
import './home_rect_curso.css';

export class HomeCurso extends React.Component {
    constructor(props){
        super(props);
    }
    render() {
        return (
            <div className="retangulo-curso col-3 fundo-amarelo">
                <div className="col-4">
                    <h3 className="texto-branco">{this.props.nomecurso}</h3>
                </div>
            </div>
        )
    }
}
